import React, { useState } from "react";
import Login from "./containers/login";
import { BrowserRouter, Route, Switch, Router } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.css";
import "./App.css";
function App() {
  return (
    <BrowserRouter>
      <Route exact path="/" component={Login} />
    </BrowserRouter>
  );
}

export default App;
